import { useNavigate } from 'react-router-dom';
import { useEffect } from 'react';

export default function Models({ visitedForexPair, selectedCurrency, alternativeCurrencies }) {
  const navigate = useNavigate();

  useEffect(() => {
    // Sprawdź, czy odwiedzono ForexPair oraz wybrano walutę bazową i alternatywne
    if (!visitedForexPair || !selectedCurrency || alternativeCurrencies.length < 2) {
      navigate('/forex-pair');  // Przekierowanie do ForexPair, jeśli nie wybrano walut
    }
  }, [visitedForexPair, selectedCurrency, alternativeCurrencies, navigate]);

  return (
    <div>
      <h1>Models Page</h1>
      <p>Selected Base Currency: {selectedCurrency}</p>
      <p>Selected Alternative Currencies: {alternativeCurrencies.join(', ')}</p>
      {/* Tutaj dodaj logikę modeli treningowych */}
    </div>
  );
}
